import React from 'react';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';
import Header from './Frontpage/Header';
import DesignsLayover from './Frontpage/DesignsLayover';
import Content3 from './Frontpage/Content3';
import Footer from './Frontpage/Footer';
import Admin from './Admin'; // Create Admin component separately

function App() {
  return (
    <Router>
      <div>
        <Header />
        <Switch>
          <Route path="/admin">
            <Admin />
          </Route>
          <Route path="/">
            <DesignsLayover />
            {/* <h2>Hello world</h2> */}
            <Content3 />
            <Footer />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
